	public static String getPayType(String IAD){
		String IADHEX10="",IADHEX11="",IADHEX17="",IADBIN17="",IADBIN18="",IADBIN19="",payType="";
		try {
			if(IAD.length()>=20){
				IADHEX10=IAD.substring(18, 20);
				//HCE
				if("A1".equals(IADHEX10)){
					payType=PayType.HCE.getValue();
					return payType;
				}
				if(IAD.length()>=36){
					IADHEX17=IAD.substring(32, 34);
					String IADHEX18 = IAD.substring(34, 36);
					IADBIN18=AsciiCodec.hexString2binaryString(IADHEX18);
					if(IADBIN18.length()==8){
						//Apple
						if("07".equals(IADHEX10)&&"80".equals(IADHEX17)&&"1011".equals(IADBIN18.substring(0, 4))){
							payType=PayType.APPLEPAY.getValue();
							return payType;
						}
					}
					if(IAD.length()>=38){
						IADHEX11=IAD.substring(20, 22);
						String IADHEX19 = IAD.substring(36, 38);
						IADBIN17=AsciiCodec.hexString2binaryString(IADHEX17);
						IADBIN19=AsciiCodec.hexString2binaryString(IADHEX19);
						if(IADBIN17.length()==8&&IADBIN19.length()==8){
							if("07".equals(IADHEX10)&&"02".equals(IADHEX11)&&"000".equals(IADBIN17.substring(5, 8))){
								//三星（PBOC）
								if("01000011".equals(IADBIN19)){
									payType=PayType.SXPAY.getValue();
									return payType;
								}
								//华为
								if("01000001".equals(IADBIN19)){
									payType=PayType.HWPAY.getValue();
									return payType;
								}
								//小米
								if("01000010".equals(IADBIN19)){
									payType=PayType.XMPAY.getValue();
									return payType;
								}
								//中兴
								if("01000100".equals(IADBIN19)){
									payType=PayType.ZXPAY.getValue();
									return payType;
								}
								//联想
								if("01000101".equals(IADBIN19)){
									payType=PayType.LXPAY.getValue();
									return payType;
								}
								//咕咚
								if("01000110".equals(IADBIN19)){
									payType=PayType.GDPAY.getValue();
									return payType;
								}
							}
						}
					}
				}
			}
			payType=PayType.HK.getValue();
			return payType;
		} finally {
			LOG.info("最终返回类型[{}],第10字节[0x{}],第11字节[0x{}],第17字节[0x{}],第17字节[{}b],第18字节[{}b],第19字节[{}b]"
					,PayType.get(payType),IADHEX10,IADHEX11,IADHEX17,IADBIN17,IADBIN18,IADBIN19);
		}
	}
	
	
